已知 \(\omega\) 是复数且满足 \(\omega^3 = 1\)，我们知道 \(\omega\) 是一个原初的三次单位根。三次单位根是方程 \(x^3 - 1 = 0\) 的解，可以分解为 \((x-1)(x^2 + x + 1) = 0\)。因此，单位根是 \(1, \omega, \omega^2\)，其中 \(\omega\) 和 \(\omega^2\) 满足方程 \(\omega^2 + \omega + 1 = 0\)。

我们需要找到 \( rac{1}{1 + \omega} +  rac{1}{1 + \omega^2}\) 的值。

首先，我们为两个分数找到一个共同的分母：
\[
 rac{1}{1 + \omega} +  rac{1}{1 + \omega^2} =  rac{(1 + \omega^2) + (1 + \omega)}{(1 + \omega)(1 + \omega^2)} =  rac{2 + \omega + \omega^2}{(1 + \omega)(1 + \omega^2)}.
 \]
由于 \(\omega^2 + \omega + 1 = 0\)，我们有 \(\omega + \omega^2 = -1\)。因此，分子简化为：
\[
2 + \omega + \omega^2 = 2 - 1 = 1.
\]
接下来，我们简化分母：
\[
(1 + \omega)(1 + \omega^2) = 1 + \omega + \omega^2 + \omega^3 = 1 + \omega + \omega^2 + 1 = 2 + \omega + \omega^2 = 2 - 1 = 1.
\]
因此，表达式简化为：
\[
 rac{1}{1} = 1.
\]
值是 \( oxed{1}\)。{
